import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';

const Homepage = () => {
  const [trends, setTrends] = useState([]);
  const [hashtags, setHashtags] = useState([]);

  useEffect(() => {
    // Mock data for today's trends
    setTrends([
      { id: 1, title: 'Sustainable Products', engagement: '2.3M', growth: '+15%' },
      { id: 2, title: 'Local Malaysian Brands', engagement: '1.8M', growth: '+22%' },
      { id: 3, title: 'Tech Gadgets', engagement: '1.5M', growth: '+8%' },
      { id: 4, title: 'Food & Beverage', engagement: '3.1M', growth: '+12%' }
    ]);

    setHashtags([
      '#MalaysianMade', '#SustainableLiving', '#TechMalaysia', '#LocalBrand',
      '#EcoFriendly', '#Innovation', '#SmallBusiness', '#MadeInMalaysia'
    ]);
  }, []);

  return (
    <div className="main-content">
      {/* Hero Section */}
      <section className="hero" style={{ textAlign: 'center', marginBottom: '4rem' }}>
        <div className="card">
          <h1 style={{ fontSize: '3rem', marginBottom: '1rem', background: 'linear-gradient(45deg, #3b82f6, #60a5fa)', WebkitBackgroundClip: 'text', WebkitTextFillColor: 'transparent', textShadow: '0 0 30px rgba(59, 130, 246, 0.3)' }}>
            Create Viral Marketing Campaigns with AI
          </h1>
          <p style={{ fontSize: '1.2rem', color: 'rgba(255, 255, 255, 0.7)', marginBottom: '2rem', maxWidth: '600px', margin: '0 auto 2rem' }}>
            Generate professional marketing content for Malaysian SMEs. No marketing team needed.
          </p>
          <div style={{ display: 'flex', gap: '1rem', justifyContent: 'center', flexWrap: 'wrap' }}>
            <Link to="/register" className="btn btn-primary" style={{ fontSize: '1.1rem', padding: '1rem 2rem' }}>
              Start Creating Free
            </Link>
            <Link to="/login" className="btn btn-secondary" style={{ fontSize: '1.1rem', padding: '1rem 2rem' }}>
              Login
            </Link>
          </div>
        </div>
      </section>

      {/* Today's Trends */}
      <section style={{ marginBottom: '3rem' }}>
        <h2 style={{ marginBottom: '2rem', textAlign: 'center', color: 'white' }}>Today's Ad Trends in Malaysia</h2>
        <div className="grid grid-2">
          {trends.map(trend => (
            <div key={trend.id} className="card">
              <h3 style={{ color: '#60a5fa', marginBottom: '0.5rem' }}>{trend.title}</h3>
              <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center' }}>
                <span style={{ color: '#666' }}>Engagement: {trend.engagement}</span>
                <span style={{ color: '#22c55e', fontWeight: '600' }}>{trend.growth}</span>
              </div>
            </div>
          ))}
        </div>
      </section>

      {/* Viral Hashtags */}
      <section style={{ marginBottom: '3rem' }}>
        <h2 style={{ marginBottom: '2rem', textAlign: 'center', color: 'white' }}>Trending Hashtags</h2>
        <div className="card">
          <div style={{ display: 'flex', flexWrap: 'wrap', gap: '0.5rem' }}>
            {hashtags.map((hashtag, index) => (
              <span 
                key={index} 
                style={{ 
                  background: 'linear-gradient(45deg, #667eea, #764ba2)', 
                  color: 'white', 
                  padding: '0.5rem 1rem', 
                  borderRadius: '20px', 
                  fontSize: '0.9rem',
                  fontWeight: '500'
                }}
              >
                {hashtag}
              </span>
            ))}
          </div>
        </div>
      </section>

      {/* Features */}
      <section>
        <h2 style={{ marginBottom: '2rem', textAlign: 'center', color: 'white' }}>Why Choose nebula.ai?</h2>
        <div className="grid grid-3">
          <div className="card" style={{ textAlign: 'center' }}>
            <div style={{ fontSize: '3rem', marginBottom: '1rem' }}>ðŸš€</div>
            <h3 style={{ marginBottom: '1rem', color: '#667eea' }}>AI-Powered</h3>
            <p style={{ color: '#666' }}>Generate professional content using advanced AI models trained for Malaysian market</p>
          </div>
          <div className="card" style={{ textAlign: 'center' }}>
            <div style={{ fontSize: '3rem', marginBottom: '1rem' }}>âš¡</div>
            <h3 style={{ marginBottom: '1rem', color: '#667eea' }}>Lightning Fast</h3>
            <p style={{ color: '#666' }}>Create complete campaigns in minutes, not hours or days</p>
          </div>
          <div className="card" style={{ textAlign: 'center' }}>
            <div style={{ fontSize: '3rem', marginBottom: '1rem' }}>ðŸŽ¯</div>
            <h3 style={{ marginBottom: '1rem', color: '#667eea' }}>Malaysian-Focused</h3>
            <p style={{ color: '#666' }}>Optimized for local trends, language, and cultural preferences</p>
          </div>
        </div>
      </section>
    </div>
  );
};

export default Homepage;
